import React from 'react'
import Slider from "react-slick";
import './index.css'


function ConsultationCarousel({ data }) {

    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
    };

    return (
        <div style={{ backgroundColor: "red", width: "97%", height: "230px" }}>
            <Slider arrows={false} {...settings}>
                {
                    data && data.length > 0 &&

                        <div style={{ backgroundColor: "green !important", width: "100%", height: "100%" }}>
                            <h3>1</h3>
                        </div>


                }
                <div style={{ backgroundColor: "green !important", width: "100%", height: "100%" }}>
                    <h3>1</h3>
                </div>
                <div style={{ backgroundColor: "blue", width: "100%", height: "100%" }}>
                    <h3>2</h3>
                </div>

            </Slider>
        </div>
    )
}

export default ConsultationCarousel
